import React from 'react';
import './Map.css'; // Import the CSS file

const Map = () => {
  return (
    <div className="container">
      <div className="row">
        {/* <h2>
          Responsive <small>Google Maps</small>
        </h2> */}

        <div className="custom-box">
          <h3 className="text-center">Find Us Here</h3>
          <div className="map-responsive">
            <iframe
              src=""
              width="600"
              height="450"
              frameBorder="0"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              title="Google Map"
            ></iframe>
          </div>
        </div>
      </div>
      <hr />
    </div>
  );
};

export default Map;
